import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Navbar from '../Components/Navbar';
import Login from '../Components/Login';
import img from '../assets/note.jpg'



export default function Home() {
    const paperstyle = {marginTop:100};
    return (
        <>
            <Navbar />
            <Grid container justifyContent="center">
            {/* <Grid item xs={12} sm={10} md={8} lg={10} justifyContent="center"  style={{border:"1px solid lightgray" ,height:"93.4vh",width:"80vw"}}> */}
                <Paper elevation={3} style={paperstyle}  xs={12} sm={10} md={8} lg={12}>
                  <Grid container spacing={3} justifyContent="center" xs={12} sm={10} md={8} lg={20}>
                            <Grid item xs={12} sm={6} lg={6}>
                                <img src={img}  style={{ width: '80%', height: '80%', objectFit: 'cover' }}></img>
                            </Grid>
                            <Grid item xs={12} sm={6} lg={6}>
                                <Login />
                            </Grid>
                        </Grid>
                </Paper>
            </Grid>
            {/* </Grid> */}
        </>
    );
}



